<!doctype html>
<html lang="en">

<head>
    <title>Code coverage report</title>
    <link rel="stylesheet" href="../../base.css" />
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1">
</head>

<body>
    <h3 style="margin: 16px 0 4px 32px">Class</h3>
    <pre class="source"><span><a href="../../index.html">all packages</a></span><span style="margin-left: 10px"><a href="../index.html">{{package}}</a></span><span class="strong" style="margin-left: 10px">{{class}}</span></pre>
    {{summary}}
    <div style="padding: 0px 32px 32px;">
        <table class="summary">
            <thead class="summary-head">
                <tr>
                    <th>Methods</th>
                    <th/>
                    <th>Branches</th>
                    <th/>
                    <th>Lines</th>
                    <th/>
                    <th>Complexity</th>
                </tr>
            </thead>
            <tbody class="summary-body">
                {{methods}}
            </tbody>
        </table>
    </div>
</body>

</html>
